def isSubsequence(s, t):
    i = 0;
    j = 0;
    count = 0;
    if not len(s):
        return False;
    while i < len(t):
        #print(s[j],'.....',t[i]);
        if s[j] == t[i] and j < len(s):
            count = count+1;
            j = j+1;
        i = i+1;
    print(count,'....',len(s))
    if count == len(s):
        return True;
    else:
        return False;
print(isSubsequence("","ahbgdc"));
print(isSubsequence("abc", "ahbgdc"));
print(isSubsequence("aec", "abcde"));
print(isSubsequence("axc", "ahbgdc"));
print(isSubsequence("leeeeetcode",""))